import React, {Component} from 'react'; 
import { Table, Tag, Space } from 'antd';
import 'katex/dist/katex.min.css';
import { InlineMath, BlockMath } from 'react-katex';

function MyTable(props) {

    const columns = [
        {
            title: 'Fución Densidad',
            dataIndex: 'fd',
            key: 'm',
            width: "200px"
        },
        {
            title: 'Fución Masa Probabilidad',
            dataIndex: 'fm',
            key: 'm',
            width: "200px"
        },
        {
        title: 'Media',
        dataIndex: 'm',
        key: 'm',
        width: "200px"
        },
        {
        title: 'Varianza',
        dataIndex: 'v',
        key: 'v',
        width: "200px"
        },
        {
        title: 'Desviación Típica',
        dataIndex: 'd',
        key: 'd',
        width: "200px"
        }

    ];

    const data = [
        {
        m: <> <InlineMath math={props.stringfuncionDensidad}/> = {props.media}</>,
        v:props.varianza,
        d:props.varianza**(0.5),
        fd:<BlockMath math={props.stringfuncionDensidad}/>,
        fm:<BlockMath math={"2x"}/>
        }
    ]

    return(
        <Table pagination={{hideOnSinglePage:true}} columns={columns} dataSource={data}/>
    );
}

export default MyTable;
